import React from 'react';

function Square({chooseSquare, val}) {
    return( 
        <div className='square' style={
            {backgroundColor: val === "" ? "white" : (val === "X" ? "green" : "red")}} 
            onClick={chooseSquare} aria-role="button" aria-pressed="false">
            {val}    
        </div>
    )
}

export default Square;
